import React from "react";
import CardStyled from "./styled/CardStyled";
import VideoBlock from "./VideoBlock";
import CardInfo from "./CardInfo";

const Card = () => {
  return (
    <>
      <CardStyled>
        <VideoBlock />
        <div>
          <CardInfo />
        </div>
      </CardStyled>
    </>
  );
};

export default Card;
